import React, { Component } from 'react'
class Citys extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() { 
        return ( 
        <React.Fragment>
            <div className="contci">
                <div className="headci">
                    <h4>Cities Near You</h4>
                    <a className="tag" href="/en-US/cities/">View all 500+ cities</a>
                </div>

            </div>
            <div className="row">
                <div className="col-4">Atlanta</div>
                <div className="col-4">Dallas-Fort Worth</div>
                <div className="col-4">Baltimore-Maryland</div>
                <div className="col-4">Baltimore-Maryland</div>
            </div>
            </React.Fragment>
         );
    }
}
 
export default Citys;
